                    otherwise
                        obj.map = [];
                        obj.qam_real_bits = [];
                        obj.qam_im_bits = [];
                        obj.const_normalization = [];
                end
                
            end
        end

        function [data_out, data_left] = RandMpeg(obj, data_mpeg)
            data_mpeg(1:1504:end) = 0xb8;
            div = floor(length(data_mpeg)/1504)*1504;

            data = data_mpeg(1:div);

            data_left = data_mpeg(div+1:end);

            sync_b_start = 1505:1504:12032;
            bytes = 0:7;

            sync_b_idx = sync_b_start + bytes.';
            sync_b_idx = sync_b_idx(:).';
            sync_b_matrix = repmat([0,1,0,0,0,1,1,1],div*8/12032,7);

            data_bin = de2bi(data, 'left-msb');

            data_pn = reshape(data_bin',12032,[])';

            data_pn(:,9:end) = double(xor(data_pn(:,9:end), obj.pn_seq));
            data_pn(:, sync_b_idx) = sync_b_matrix;

            bits_out = reshape(data_pn', 8,[])';
            data_out = bi2de(bits_out, 'left-msb');
        end
        

        function coded_msg = RS(obj,sym)
            sym = reshape(sym, 188,[])';

            msg = gf(sym, 8, obj.p_gen);
            
            y = rsenc(msg, obj.n, obj.k);
            coded_msg = reshape(y.x',1,[]);

        end

     

        function [data_convintrl, state] = Conv_Intrl(obj,data)
            [intrlvData, state] =convintrlv(data, obj.nrows, obj.slope);
            data_convintrl = intrlvData(:);
        end

        function coded_data = Conv_Code(obj, data)
            % Codigo Convolucional con perforaciones
            if(mod(length(data),length(obj.punc_pat)/2) ~= 0)
                pad_z = mod(-length(data), length(obj.punc_pat)/2);
                data = [data, zeros(1, pad_z)];
            end
            trellis = poly2trellis(obj.len,obj.code_gen);
            coded_data = convenc(data, trellis, obj.punc_pat);
        end
        
        
        function k_idx = Sct_Pilots(obj,l)
            in = 3*mod(l,4);
            k_idx = in:12:obj.K_max;
        end

        function [bit_intrl,left_state] = Bit_Intrlv(obj,data)
           
            
            [intrlived, left_state] =convintrlv(data, obj.Modulacion, 120);
            bit_intrl = intrlived(:);

        end

        function [ak, left_bits] = Bi2QAM(obj, bits_stream)
            if mod(length(bits_stream), obj.Modulacion) ~= 0
                div = floor(length(bits_stream)/obj.Modulacion)*obj.Modulacion;
                left_bits = bits_stream(div+1:end);
                bits_stream = bits_stream(1:div);
                
            end
            bits_sym = reshape(bits_stream,obj.Modulacion,[])';
            qam_r = bi2de(bits_sym(:, obj.qam_real_bits),'left-msb');
            qam_i = bi2de(bits_sym(:, obj.qam_im_bits),'left-msb');

            

            ak_r = obj.map(qam_r + 1);
            ak_i = obj.map(qam_i + 1);

            ak = ak_r + 1i * ak_i;

            ak = ak/sqrt(obj.const_normalization);
        end



        function [ofdm_frame, Data_sin_uso] = Frame(obj, Data, AC_bits, sync,dif_sincrona, radio, rx_parcial, rx_parcial_prox, capa_A, capa_B, capa_C)
            

            TMCC = obj.TpsBits(sync,dif_sincrona, radio, rx_parcial, rx_parcial_prox, capa_A, capa_B, capa_C);
            TMCC_parity = obj.CyclycCode(TMCC);

            TMCC_bit = [TMCC, TMCC_parity];
            ofdm_frame = 3*ones(204,obj.K_max+1);

            s_0 = (1- 2 * obj.wk(obj.TPS_K + 1))*4/3;
            ac_0 = (1- 2 * obj.wk(obj.AC_carriers+1))*4/3;

            TPS_Matrix = zeros(204, length(obj.TPS_K));
            AC_Matrix = zeros(204, length(obj.AC_carriers));

            TPS_Matrix(1,:) = s_0.';
            AC_Matrix(1,:) = ac_0.';

            TPS_Matrix(2:end,:) = TPS_Matrix(2:end,:) + TMCC_bit.';
            AC_Matrix(2:end,:) = AC_Matrix(2:end,:) + AC_bits.';

            for j= 2:204
                TPS_Matrix(j,:) = (TPS_Matrix(j,:)*(-2) + 1).*TPS_Matrix(j-1,:);
                AC_Matrix(j,:) = (AC_Matrix(j,:)*(-2) + 1).*AC_Matrix(j-1,:);
            end
            ofdm_frame(:,obj.TPS_K+1) = TPS_Matrix;
            ofdm_frame(:, obj.AC_carriers+1) = AC_Matrix;
            Data_sin_uso = Data;
            
            idx_0 = 0:4:203;
            idx_1 = 1:4:203;
            idx_2 = 2:4:203;
            idx_3 = 3:4:203;

            k_scatter_0 = obj.Sct_Pilots(0);
            scatter_p0 = obj.wk(k_scatter_0+1);
            Sct_Matrix_0 = repmat(4/3 *(1 - 2 * scatter_p0),length(idx_0),1);

            k_scatter_1 = obj.Sct_Pilots(1);
            scatter_p1 = obj.wk(k_scatter_1+1);
            Sct_Matrix_1 = repmat(4/3 *(1 - 2 * scatter_p1),length(idx_1),1);

            k_scatter_2 = obj.Sct_Pilots(2);
            scatter_p2 = obj.wk(k_scatter_2+1);
            Sct_Matrix_2 = repmat(4/3 *(1 - 2 * scatter_p2),length(idx_2),1);

            k_scatter_3 = obj.Sct_Pilots(3);
            scatter_p3 = obj.wk(k_scatter_3+1);
            Sct_Matrix_3 = repmat(4/3 *(1 - 2 * scatter_p3),length(idx_3),1);

            
            
   
            ofdm_frame(idx_0 + 1, k_scatter_0 + 1) = Sct_Matrix_0;
            ofdm_frame(idx_1 + 1, k_scatter_1 + 1) = Sct_Matrix_1;
            ofdm_frame(idx_2 + 1, k_scatter_2 + 1) = Sct_Matrix_2;
            ofdm_frame(idx_3 + 1, k_scatter_3 + 1) = Sct_Matrix_3;

            
            data_segs = size(Data_sin_uso, 2);

            if( data_segs >= 204)
                for i = 1:204
                    ofdm_frame(i, ofdm_frame(i,:) == 3) = Data_sin_uso(i,:);
                    
                end
                if (data_segs > 204)
                    Data_sin_uso = Data_sin_uso(205:end,:);
                else
                    Data_sin_uso = [];
                end
            else
                display(-1)

            end

        end

