                    aux = [aux, Conv_rate(2,:)];
                case 2
                    aux = [aux, Conv_rate(3,:)];
                case 3
                    aux = [aux, Conv_rate(4,:)];
                case 4
                    aux = [aux, Conv_rate(5,:)];
                case 7
                    aux = [aux, Conv_rate(6,:)];
                otherwise
                    return
            end
            
            switch capa_C(2,3)
                case 0
                    aux = [aux, Intrl_long(1,:)];
                case 1
                    aux = [aux, Intrl_long(2,:)];
                case 2
                    aux = [aux, Intrl_long(3,:)];
                case 3
                    aux = [aux, Intrl_long(4,:)];
                case 7
                    aux = [aux, Intrl_long(5,:)];
                otherwise
                    return
            end

            switch capa_C(2,4)
                case 1
                    aux = [aux, num_seg(1,:)];
                case 2
                    aux = [aux, num_seg(2,:)];
                case 3
                    aux = [aux, num_seg(3,:)];
                case 4
                    aux = [aux, num_seg(4,:)];
                case 5
                    aux = [aux, num_seg(5,:)];
                case 6
                    aux = [aux, num_seg(6,:)];
                case 7
                    aux = [aux, num_seg(7,:)];
                case 8
                    aux = [aux, num_seg(8,:)];
                case 9
                    aux = [aux, num_seg(9,:)];
                case 10
                    aux = [aux, num_seg(10,:)];

                case 11
                    aux = [aux, num_seg(11,:)];
                case 12
                    aux = [aux, num_seg(12,:)];
                case 13
                    aux = [aux, num_seg(13,:)];
                case 15
                    aux = [aux, num_seg(14,:)];
                otherwise
                    return
            end
            

            aux = [aux, ones(1, 15)];
            Tps = aux;
            



        end

        function parity_bits = CyclycCode(obj, data)
            shift_data = [zeros(1, obj.n_tps-obj.k_tps), data];

            max_p_data = find(shift_data == 1);
            max_p_data = max_p_data(end);
            shift_data = shift_data(1:max_p_data);
            while max_p_data>=obj.n_tps-obj.k_tps+1

                divi = [zeros(1,max_p_data - (obj.n_tps-obj.k_tps)-1), obj.g];

                r = xor(shift_data, divi);

                max_p_data = find(r == 1);
                if isempty(max_p_data)
                    shift_data = zeros(1, obj.n_tps-obj.k_tps);
                    max_p_data = 0;
                else
                    max_p_data = max_p_data(end);

                    shift_data = r(1:max_p_data);
                end
            end
            parity_bits = [double(shift_data), zeros(1, (obj.n_tps-obj.k_tps)-length(shift_data))];
        end

    end
